import { Map, List } from "immutable";
export const respToTodos = (resp) => {
  const data = List([]);
  const todos = resp.data;
  console.log(todos);
  todos.forEach(({ todo }) => {
    data.push(
      Map({
        ...todo,
      })
    );
  });
  console.log(data);
  return data;
};
